import React, { useState, useEffect } from "react";
import "./App.css";

const App = () => {
  const rates = useApp();
  console.log(rates.base);

  return <div className="App"></div>;
};

const useApp = () => {
  const [rates, setRates] = useState();

  useEffect(() => {
    fetch(
      "https://openexchangerates.org/api/latest.json?app_id=37ce05177037491283b06fe29e31e8f3"
    )
      .then((res) => res.json()) //response type
      .then(setRates);
  }, []);

  return rates;
};

export default App;
